const getSigByZip = (zip) => {
    console.log("zip", zip)
    for (let i = 0; i < objRef.sigByZip.length; i++) {
        let indexOfZip = objRef.sigByZip[i].zipCodes.indexOf(zip)
        if (indexOfZip > -1) {
            return objRef.sigByZip[i].siglas
        }
    }
    return {"error":"No se pudo encontrar las siglas del CP " + zip}
}
const getZoneByConcatSig = (concatSig) => {
    for (let i=0; i< objRef.zoneBySig.length; i++){
        let indexOfZone = objRef.zoneBySig[i].siglas.indexOf(concatSig)
        if(indexOfZone > -1) {
            return objRef.zoneBySig[i].zone
        } 
    }
    return  {"error":"No se pudo encontrar la zona de las siglas" + concatSig}
}

module.exports = {
    getZoneByZips: async (zip1, zip2) => {
        if(zip1.charAt(0) === "0"){
            zip1 =  zip1.slice(1,zip1.length)
        }
        if(zip2.charAt(0) === "0"){
            zip2 =  zip2.slice(1,zip2.length)
        }
        const sig1 = getSigByZip(zip1)
        const sig2 = getSigByZip(zip2)
        const concatForZone = sig1 +sig2
        const zone = getZoneByConcatSig(concatForZone)
        return zone
    }

}